syntax = "proto3";
package proto;
import "Request.proto";
import "Response.proto";

option java_package = "net.iGap.proto";
option java_outer_classname = "ProtoSignalingClearLog";

message SignalingClearLog {
    Request request = 1;
    uint64 clear_id = 2;
}

message SignalingClearLogResponse {
    Response response = 1;
    uint64 clear_id = 2;
}